function toggleMenu() {
  const navLinks = document.getElementById('navLinks');
  navLinks.classList.toggle('active');
}

import React from 'react';
import './styles.css';  // För att använda din CSS-fil

function Home() {
  return (
    <div className="home-page">
      {/* Navigation */}
      <nav>
        <div className="nav-container">
          <div className="logo">Mitt CV</div>
          <div className="hamburger" onClick={() => toggleMenu()}>☰</div>
          <ul className="nav-links" id="navLinks">
            <li><a href="/">Hem</a></li>
            <li><a href="/about">Om mig</a></li>
            <li><a href="/cv">CV</a></li>
            <li><a href="/portfolio">Portfolio</a></li>
            <li><a href="/contact">Kontakt</a></li>
          </ul>
        </div>
      </nav>

      {/* Header */}
      <header>
        <h1>Välkommen till mitt CV</h1>
      </header>

      {/* Main Content */}
      <main>
        <section className="homeText">
          <h2>Hej!</h2>
          <p>Välkommen till min personliga webbplats. Här hittar du information om mig, mitt CV och min portfolio.</p>
        </section>
      </main>

      {/* Footer */}
      <footer>
        <p>&copy; 2025 Mitt CV</p>
      </footer>
    </div>
  );
}


export default Home;
